class Keypad extends Component {

    render() {
        return (
            <div className="button">
                <button name="AC" onClick={e => this.props.onClick(e.target.name)}>AC</button>
                <button name="AC" onClick={e => this.props.onClick(e.target.name)}>AC</button>

            </div>
        );
    }
}


export default Keypad;
